import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

  function AboutMe() {
    return (
        <Container
        fixed
        sx={{
          bgcolor: "transparent",
          marginTop: '10vh', 
          marginBottom: '10vh',
        }}
        >
        </Container>
    )
  };

  export default AboutMe;
